'''凯萨琳·华特'''（'''{{Lang-ja|キャサリン·ワード}}'''）是由[[真田诚|真田まこと]]所制作的游戏'''《[[杀戮的天使]]》'''的登场角色。

== 简介 ==

身著黑色上衣和緊身裙，搭配長靴，紅色的手套和領帶，豐滿的身材性感的容貌。頭髮為金色和紅色的漸變。;

給予自己判定為罪人的人於痛苦而感到喜悅的抖S，雖然是十分爽朗的說話方式但是會說出看不起對方的話。;

== 经历 ==
* Floor B3层主;
* 出生在双亲都是医者的家庭，接受了高等教育的千金小姐;
* {{黑幕|与毕生好友Lucy相遇}};
* 立于常人之上，对于违逆之人会加以制裁;
* 在女子学校学习的时候父母因为医疗失误而结仇后被杀害;
* 家庭没落，变得孑然一身。那之后在学校里被人厌恶;
* 欺负Cathy的学生们接二连三的没有再去学校;
* 担任刑务所的看守之后，一部分的囚犯下落不明;
* 和Danny相遇，听说了关于大楼的事情;
* 进入大楼成为B3的层主;
* 从精神上挑拨Zack和Ray的关系，同时迫使Zack回忆起往事;
* 因为被Ray的手枪射中而情绪高涨，被Zack用镰刀切掉手腕之后砍死。

